// Ê∑ªÂä† @media print Ê†∑Âºè
const style = document.createElement('style');
style.textContent = `
  @media print {
    .no-print {
      display: none !important;
    }
  }
`;
document.head.appendChild(style);

(function () {
    'use strict';

    const targetClass = 'hidden_analysis'; // üëà ÊõøÊç¢‰∏∫‰Ω†Ë¶ÅÈöêËóèÁöÑÁ±ªÂêçÔºà‰∏çÂ∏¶ÁÇπÔºâ

    // ÂàõÂª∫ÊåâÈíÆ
    const btn = document.createElement('button');
    btn.textContent = '‰∏∫Â¶àÂ¶àÊòæÁ§∫ÊâÄÊúâÁ≠îÊ°à';
    btn.style.position = 'fixed';
    btn.style.bottom = '20px';
    btn.style.right = '20px';
    btn.style.zIndex = '9999';
    btn.style.padding = '10px 16px';
    btn.style.backgroundColor = '#fb7299';
    btn.style.color = 'white';
    btn.style.border = 'none';
    btn.style.borderRadius = '6px';
    btn.style.cursor = 'pointer';
    btn.style.boxShadow = '0 2px 6px rgba(0,0,0,0.2)';
    btn.className = 'no-print';

    // ÂàõÂª∫‚ÄúÊâìÂç∞È°µÈù¢‚ÄùÊåâÈíÆ
    const printBtn = document.createElement('button');
    printBtn.textContent = '‰∏ÄÈîÆÊâìÂç∞';
    printBtn.className = 'no-print';
    Object.assign(printBtn.style, {
        position: 'fixed',
        bottom: '20px',
        right: '220px', // ËÆ©ÂÆÉÂíå showBtn Âπ∂Êéí
        zIndex: 9999,
        padding: '10px 16px',
        backgroundColor: '#4caf50',
        color: 'white',
        border: 'none',
        borderRadius: '6px',
        cursor: 'pointer',
        boxShadow: '0 2px 6px rgba(0,0,0,0.2)'
    });

    function showAnimatedImage() {
        const img = document.createElement("img");
        img.src = "data:image/jpeg;base64,"; // ‰Ω†ÂèØ‰ª•Êç¢ÊàêËá™Â∑±ÁöÑÂõæÔºàÁΩëÁªúÂõæÊàñ base64Ôºâ

        Object.assign(img.style, {
            position: "fixed",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            width: "200px",
            zIndex: "9999",
            animation: "shake 1s ease-in-out 3", // ÊäñÂä®1ÁßíÔºåÈáçÂ§ç3Ê¨°ÔºåÊÄªÂÖ±3Áßí
            pointerEvents: "none"
        });

        // ÊèíÂÖ•Ê†∑ÂºèÔºàÂè™ÊèíÂÖ•‰∏ÄÊ¨°Ôºâ
        if (!document.getElementById("shake-style")) {
            const style = document.createElement("style");
            style.id = "shake-style";
            style.textContent = `
      @keyframes shake {
        0% { transform: translate(-50%, -50%) rotate(0deg); }
        20% { transform: translate(-50%, -50%) rotate(-10deg); }
        40% { transform: translate(-50%, -50%) rotate(10deg); }
        60% { transform: translate(-50%, -50%) rotate(-10deg); }
        80% { transform: translate(-50%, -50%) rotate(10deg); }
        100% { transform: translate(-50%, -50%) rotate(0deg); }
      }
    `;
      document.head.appendChild(style);
  }

    document.body.appendChild(img);

    // ÁßªÈô§ÂõæÁâáÔºàÂä®ÁîªÂÆåÊàêÂêé 3 ÁßíÔºâ
    setTimeout(() => {
        img.remove();
    }, 2000); // ‚è±Ô∏è ÊéßÂà∂ÊòæÁ§∫Êó∂Èïø
}

    // ÊåâÈíÆÁÇπÂáª‰∫ã‰ª∂
    btn.onclick = () => {

        showAnimatedImage()

        //ÊòæÁ§∫ÊâÄÊúâÁ≠îÊ°à
        const elements = document.querySelectorAll(`.${targetClass}`);
        if (elements.length === 0) {
            alert(`Ê≤°ÊúâÊâæÂà∞Á±ªÂêç‰∏∫ "${targetClass}" ÁöÑÂÖÉÁ¥†`);
            return;
        }
        elements.forEach(el => {
            el.style.display = 'block';
            el.style.width = 'unset';
            el.style.padding = 0;

            const divChildren = Array.from(el.children).filter(e => e.tagName.toLowerCase() === 'div');
            // Á¨¨‰∏Ä‰∏™ <div> Ê†∑Âºè‰ºòÂåñ
            if (divChildren[0]) {
                divChildren[0].style.display = 'flex';
                divChildren[0].style.padding= 0

                // üëâ ËÆæÁΩÆ divChildren[0] ‰∏≠Á¨¨‰∫å‰∏™ <div> ‰∏∫ flex: 1
                const innerDivs = Array.from(divChildren[0].children).filter(e => e.tagName.toLowerCase() === 'div');
                if (innerDivs[1]) {
                    innerDivs[1].style.flex = '1';
                }
            }

            // ÈöêËóèÁ¨¨‰∫å‰∏™ <div>  Ëß£Êûê
            if (divChildren[1]) {
                divChildren[1].style.display = 'none';
            }

            // ‚úÖ ÈöêËóè‰∏ä‰∏Ä‰∏™ÂÖÑÂºüÂÖÉÁ¥†Â¶ÇÊûúÊòØ span
            const prev = el.previousElementSibling;
            if (prev && prev.tagName.toLowerCase() === 'span') {
                prev.style.display = 'none';
            }
        });

        //Â§¥ÈÉ®Ê†∑Âºè‰ºòÂåñ
        const headEl = document.querySelector('.App > div:nth-child(1)');
        if(headEl){
            headEl.style.display = 'none';
        }

        //Ê†áÈ¢òÊ†∑Âºè‰ºòÂåñ
        const titleEl = document.querySelector('.App > div:nth-child(3) > div:nth-child(1)');
        if(titleEl){
            titleEl.style.height= '80px'
            titleEl.style.fontWeight= 'blod'
            titleEl.style.fontSize= '14px'
        }


        //ÁßªÈô§È¢òÁõÆÁ¥¢ÂºïÂç°Áâá
        const targetEl = document.querySelector('.App > div:nth-child(3) > div:nth-child(2) > div:nth-child(2)');
        if (targetEl) {
            targetEl.style.display = 'none';
        }

        //‰ºòÂåñÁ≠îÈ¢òÈÄâÈ°π
        const option_list = document.querySelectorAll('.option_list ');
        option_list.forEach(el=>{
            el.style.marginBottom = '0px'
            const optionChildren = Array.from(el.children).filter(e => e.tagName.toLowerCase() === 'span');
            if(optionChildren[0]){
                optionChildren[0].style.width= '20px'
                optionChildren[0].style.height= '20px'
            }
        })

        // ‚úÖ ÈöêËóèÊâÄÊúâ .collect-btn-bar
        const barEls = document.querySelectorAll('.collect-btn-bar');
        barEls.forEach(el => el.style.display = 'none');

        // ‚úÖ ÈöêËóèÊâÄÊúâ .ant-input
        const inputEls = document.querySelectorAll('.ant-input');
        inputEls.forEach(el => el.style.display = 'none');

        //ÁßªÈô§Á≠îÈ¢òÂå∫ÂüüËæπË∑ù ÂÆΩÂ∫¶
        const testBox = document.querySelector('.App > div:nth-child(3) > div:nth-child(2) > div:nth-child(1) > div:nth-child(1)')
        testBox.style.padding = 0;
        testBox.style.width = 'unset';

        // Á≠îÈ¢òÂå∫ÂüüÂ∏ÉÂ±Ä
        const testBoxDiv = document.querySelector('.App > div:nth-child(3) > div:nth-child(2) > div:nth-child(1) > div:nth-child(1) > div:nth-child(1)');
        testBoxDiv.style.display = 'flex';
        testBoxDiv.style.flexWrap = 'wrap';
        // Ëé∑ÂèñÂÖ∂Á¨¨‰∏ÄÂ±ÇÂ≠êÂÖÉÁ¥†‰∏≠ÊâÄÊúâÊòØ <div> ÁöÑ
        const firstLevelDivs = Array.from(testBoxDiv.children).filter(el => el.tagName.toLowerCase() === 'div');
        firstLevelDivs.forEach(div => {
            div.style.width = '50%';
            div.style.padding = '0px 5px 0 5px';
            div.style.marginBottom = '0px';
            // ÊØîÂ¶ÇÁªü‰∏ÄÁº©Â∞èÂ≠ó‰Ωì
            div.style.fontSize = '12px';
        });
    };

    printBtn.onclick = () => {
        window.print();
    };

    // Âä†ËΩΩÂêéÊ∑ªÂä†ÊåâÈíÆ
    window.addEventListener('load', () => {
        document.body.appendChild(btn);
        document.body.appendChild(printBtn);
    });
})();